import React from "react";
import MovieDbContainer from "./components/movie-db-container/movie-db-container";
import MovieDetailsContainer from "./components/movie-details-container/movie-details-container";
import MuiThemeProvider from "material-ui/styles/MuiThemeProvider";
import {BrowserRouter, Switch, Route} from "react-router-dom";

function App() {
    return (
        <MuiThemeProvider>
            <BrowserRouter>
                <Route to="/" exact component={MovieDbContainer} />
                <Route to="/movieDetail" component={MovieDetailsContainer} />
            </BrowserRouter>
        </MuiThemeProvider>
    );
}

export default App;
